import { useState } from "react";
import data from "../Data";
const Preguntas = () => {
	const [preguntas, setPreguntas] = useState({ data });
	// const { data } = preguntas;
	console.log(preguntas.data);
	return (
		<div>
			<p>
				Pregunta1: <span>{}</span>
			</p>
			<form>
				<input type="radio" id="respuesta" name="pregunta1" value="2020" />
				<label>2020</label>
				<input type="radio" id="respuesta" name="pregunta1" value="2021" />
				<label>2021</label>
				<input type="radio" id="respuesta" name="pregunta1" value="2022" />
				<label>2022</label>
			</form>
		</div>
	);
};
export default Preguntas;
